import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import MultiPageForm from "../src/components/Multipageform";

function App() {
  return (
    <Router>
      <div className="h-screen bg-cover bg-center" style={{ backgroundImage: `url('.../src/assets/images/9495457.png')` }}>
        <Routes>
          <Route path="/" element={<MultiPageForm />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
